import React, { Component } from "react";
import Slider from "react-slick";
import TiepNhanXe from '../assets/tiep-nhan-xe.jpeg';
import TuVanDichVu from '../assets/tu-van-dich-vu.jpeg';
import ThucHienDichVu from '../assets/thuc-hien-dich-vu.jpeg'
import KiemTraVeSinhXe from '../assets/kiem-tra-ve-sinh-xe.jpeg'
import BanGiaoXe from '../assets/ban-giao-xe.jpeg'


export default class SimpleSlider extends Component {
    render() {
        const settings = {
            dots: true,
            infinite: true,
            speed: 100,
            slidesToShow: 1,
            slidesToScroll: 1
        };
        return (
            <div>
                <Slider {...settings}>
                    <div>
                        <img src={TiepNhanXe} alt={TiepNhanXe} />
                    </div>
                    <div>
                        <img src={TuVanDichVu} alt={TuVanDichVu} />
                    </div>
                    <div>
                        <img src={ThucHienDichVu} alt={ThucHienDichVu} />
                    </div>
                    <div>
                        <img src={KiemTraVeSinhXe} alt={KiemTraVeSinhXe} />
                    </div>
                    <div>
                        <img src={BanGiaoXe} alt={BanGiaoXe} />
                    </div>
                </Slider>
            </div>
        );
    }
}
